              "quote": "He was a very good two-year-old but unfortunately he got cast one Sunday afternoon and shattered his pin bone. His pin bone is about four inches down his leg and we were lucky not to lose him. If he hadn't done that he'd have been a very good horse, and it's taken a  few years for him to get going again really but he's back in good from again now, winning the sprint qualifier at Windsor last week. He can be difficult to get on in the paddock, but changing the chute at Windsor to a new entrance further around the bend has made it easier for us to mount him, which is why we go back to Windsor as much as we can. He'll run in the sprint final there on August 12 all being well. He was a close fourth in it last year, but he's in better form this year. 11-07-24"
