          "quotes": [
            {
              "date": "2025-05-05",
              "horse": "Crestofdistinction",
              "horse_id": "6134836",
              "race": "Thorley Taverns Maiden Stakes (GBB Race)",
              "race_id": "893023",
              "course": "Kempton (AW)",
              "course_id": "crs_28054",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "Crestofdistinction has built well over the winter and he's always shown a lot of ability at home. He's had two racecourse gallops at Kempton prior to this and shaped up well from each one. We put the cheekpieces on because he's such a laidback horse and he's got the potential to keep improving into a nice sprinter. He's going the right way about things and I always thought he was quite smart. He was quite green last year but it was a much different story today, he pretty much dominated as soon as he jumped out - David Probert, jockey."
            }
          ],
          "stable_tour": [
            {
              "horse": "Crestofdistinction",
              "horse_id": "6134836",
              "quote": "He was third and second on his two starts last year at Doncaster and Kempton and we decided to give him a little bit of a break. He had a setback at the start of last year, which knocked his summer out, but he's back in full training and doing well. He should be able to go and win his maiden and then go on to bigger and better things. He could really progress through the sprints and handicap division this year. 02-04-25"
            }
          ],
